import React from 'react'
import '../Pokemon/Pokemon.css'
const Pokemon = ({poke}) => {
    console.log(poke)
    return (
        <div className="poke-detail">
        
            {poke && poke.map(p => {
                return(
                <div>
                <h1>{p.name}</h1>
                <img src={p.sprite} alt="" />
                
                </div>
                )
                
            })}
        </div>
    )
}

export default Pokemon
